import React, { useEffect, useState } from 'react';

const styles = {
  container: { minHeight: '100vh', background: '#111', color: '#fff', padding: '2rem' },
  card: {
    background: '#222',
    borderRadius: '8px',
    boxShadow: '0 2px 16px rgba(0,0,0,0.5)',
    padding: '1.5rem',
    marginBottom: '1.5rem',
    maxWidth: '600px',
    marginLeft: 'auto',
    marginRight: 'auto',
    position: 'relative',
  },
  title: { fontSize: '1.1rem', fontWeight: 'bold', marginBottom: '0.5rem' },
  meta: { color: '#aaa', fontSize: '0.95rem', marginBottom: '0.5rem' },
  status: { fontWeight: 'bold', marginTop: '0.5rem', color: '#0d6efd' },
  cancelButton: {
    background: '#ff4d4f',
    color: '#fff',
    border: 'none',
    borderRadius: '4px',
    padding: '0.5rem 1rem',
    cursor: 'pointer',
    fontWeight: 'bold',
    marginTop: '1rem',
    transition: 'background 0.3s',
  },
  error: { color: '#ff4d4f', marginTop: '0.5rem' },
};

function SentRequests() {
  const [requests, setRequests] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [errorMessage, setErrorMessage] = useState('');
  const [processing, setProcessing] = useState({});
  const [requestErrors, setRequestErrors] = useState({});
  const token = localStorage.getItem('token');

  const fetchRequests = async () => {
    setIsLoading(true);
    setErrorMessage('');
    if (!token) {
      setErrorMessage('You must be logged in to view sent requests.');
      setIsLoading(false);
      return;
    }
    try {
      const res = await fetch('http://localhost:5001/api/skill-requests/sent', {
        headers: { Authorization: `Bearer ${token}` },
      });
      if (!res.ok) throw new Error('Failed to fetch sent requests');
      const data = await res.json();
      setRequests(data);
    } catch (err) {
      setErrorMessage(err.message);
    } finally {
      setIsLoading(false);
    }
  };

  useEffect(() => { fetchRequests(); }, []);

  const handleCancel = async (requestId) => {
    setProcessing(prev => ({ ...prev, [requestId]: true }));
    setRequestErrors(prev => ({ ...prev, [requestId]: '' }));

    try {
      const res = await fetch(`http://localhost:5001/api/skill-requests/${requestId}/status`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json', Authorization: `Bearer ${token}` },
        body: JSON.stringify({ status: 'cancelled' }),
      });
      if (!res.ok) throw new Error('Failed to cancel request');

      // Optimistic update
      setRequests(prev => prev.map(r => r._id === requestId ? { ...r, status: 'cancelled' } : r));
    } catch (err) {
      setRequestErrors(prev => ({ ...prev, [requestId]: err.message }));
    } finally {
      setProcessing(prev => ({ ...prev, [requestId]: false }));
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={{ textAlign: 'center', marginBottom: '2rem' }}>Sent Skill Requests</h2>
      {isLoading && <div>Loading...</div>}
      {errorMessage && <div style={{ color: '#ff4d4f', textAlign: 'center' }}>{errorMessage}</div>}
      {requests.map(req => (
        <div key={req._id} style={styles.card}>
          <div style={styles.title}>Skill: {req.skill?.title}</div>
          <div style={styles.meta}>
            To: {req.owner?.name} ({req.owner?.email})<br />
            Message: {req.message}<br />
            Preferred Schedule: {req.preferredSchedule}
          </div>
          <div style={styles.status}>
            Status: {req.status.charAt(0).toUpperCase() + req.status.slice(1)}
          </div>
          {req.status === 'pending' && (
            <button
              style={styles.cancelButton}
              onClick={() => handleCancel(req._id)}
              disabled={processing[req._id]}
            >
              {processing[req._id] ? 'Cancelling...' : 'Cancel'}
            </button>
          )}
          {requestErrors[req._id] && <div style={styles.error}>{requestErrors[req._id]}</div>}
        </div>
      ))}
      {!isLoading && requests.length === 0 && !errorMessage && (
        <div style={{ textAlign: 'center', color: '#aaa' }}>No sent requests.</div>
      )}
    </div>
  );
}

export default SentRequests;
